import React from 'react';
import MagicUpdate from '../components/Magic/MagicUpdate';
import ButtonRandom from '../components/ButtonRandom';

const FMagic2 = () => {
    return (
        <>
            <ButtonRandom />
            <div>
                <MagicUpdate />
            </div>
        </>
    );
};

export default FMagic2;
